import Child from './test';
import Items from "./component/items";

class App extends Component{
  state = {
    items: [
      {id:1 , name:"ahmed" , age:20},
      {id:2 , name:"mohamed" , age:26}
    ]
  }

  change = () =>{
    this.setState ({
      name : "ay 7aga b2aaaaaa"
    })
  }





render(){
    return (
      <div className="app">
        <Child/>

        <button onClick={this.change}>click to change</button>
        <p>{ this.state.name }</p>
        <p>{this.state.age}</p>

        <Items  items={this.state.items}/>
      </div>
    );
  }
}
export default App;
